import React from "react";

const ImNav = () => {
  return (
    <>
      <div className="Im_nav_baar">
        <div className="Im-name-nave">
            <h1 className="im-name">Shutter Up</h1>
        </div>

        <div className="Im-search-box">
            <input className="Im-input" type="search" placeholder="search images"/>
            <i className="fa-solid fa-magnifying-glass search-im-icon"></i>
        </div>
        
      </div>
    </>
  );
};

export default ImNav;
